function T = find_terms(expr, T, members)
    a = 0;
    [s, s0] =size(expr);
    for j=1:s
        [s0 s2] = size(expr{j,1});
         for i=1:s2                           
            [c t] = coeffs(expr{j,1}{1, i},members);
            T(a+i) = t;
         end
         a = s2;
    end
end